import React from 'react';
import {UserContext} from "./context/UserContext";
import Home from './components/Content/Home/Home';
import './App.css';

function App() {
  return (
    <div className="App">
        <UserContext.Provider value={{userLoggedIn:false}}>
      <Home/>
        </UserContext.Provider>
    </div>
  );
}

export default App;
